import React from 'react';

type TaskTypeArray = {
    id:string;
    title:string;
    isDone:boolean
}

type TaskType = {
    title:string
    task:TaskTypeArray[]
}



export  const Todolist:React.FC<TaskType> = ({title,task,...props}) => {



    return (
        <div>
            <h3>{title}</h3>
            <input/>
            <button>Add</button>
          <ul>
              {task.map((el)=>{
                  return (
                      <li key={el.id}>
                          {el.title}
                          <input type={'checkbox'} checked={el.isDone}/>
                      </li>
                  )
              })}
          </ul>
            <button>All</button>
            <button>Active</button>
            <button>Completed</button>
        </div>
    );
};
